import React from 'react';
import './SearchImageOverview.scss';
import {connect} from 'react-redux';
import {createStructuredSelector} from 'reselect';
import {selectSearchData} from '../../Redux/Search/search-selectors';

const SearchImageOverview = ({searchData}) => {
    console.log(searchData)
    return(
        <div className="SearchImageOverview">
        </div>
    );
}

const mapStateToProps = createStructuredSelector({
    searchData: selectSearchData
});

export default connect(mapStateToProps)(SearchImageOverview);
